    <div>
        <hr style={{ backgroundColor: 'black', padding: '0.75px', marginTop: 0, marginBottom: 0 }} ></hr>
        <h2 style={{ marginBottom: 0 }} >  {props.router.query.name}</h2>
        <hr style={{ backgroundColor: 'black', padding: '0.75px', marginTop: 0, marginBottom: '25px' }} ></hr>

        {/* <h3>{props.router.query.name}</h3>
        <h3>{props.router.query.capital}</h3> */}
    </div>
));

export default () => (
    <Layout>
        <div>
            <SelectedCountry />
        </div>
    </Layout>
);

